@วันนี้ 25 ก.ค. เวลา 19:35

ปากซอยลาดพร้าว 28-32 วันนี้ยังพบมอเตอร์ไซค์ขึ้นมาขับขี่บนทางเท้าอยู่เลยครับ  อยากให้เจ้าหน้าที่ลองออกตรวจตรานอกเครื่องแบบดูบ้างแล้วจะเจอได้บ่อยแบบประชาชนทั่วไป ไม่งั้นเวลาเจอเจ้าหน้าที่แต่งกายในเครื่องแบบ มอเตอร์ไซค์ที่ไหนจะขึ้นมาขับขี่ อยากให้ลองหาวิธีการอื่น ที่จะช่วยป้องกันได้อย่างถาวร เช่น ติดตั้งแผ่นกั้นแบบขยับได้ไม่ให้มอเตอร์ไซค์ขึ้นมาขับขี่ เพราะวันไหนถ้าไม่มีเจ้าหน้าที่มา ก็จะเจอแบบนี้อยู่เป็นประจำ ชาวบ้านเดือดร้อนมาก
ปัจจุบันพื้นทางเท้าพังชำรุดเพราะมอเตอร์ไซค์หมดแล้ว

